INSERT INTO items (itemid,type,snmp_community,snmp_oid,hostid,name,key_,delay,history,trends,status,value_type,trapper_hosts,units,snmpv3_securityname,snmpv3_securitylevel,snmpv3_authpassphrase,snmpv3_privpassphrase,formula,logtimefmt,templateid,valuemapid,params,ipmi_sensor,authtype,username,password,publickey,privatekey,flags,interfaceid,port,description,inventory_link,lifetime,snmpv3_authprotocol,snmpv3_privprotocol,snmpv3_contextname,evaltype,jmx_endpoint,master_itemid) values ('27603','1','{$SNMP_COMMUNITY}','1.3.6.1.2.1.2.2.1.5.{#SNMPINDEX}','10225','Interface {#IFDESCR}: Speed','net.if.speed[ifSpeed.{#SNMPINDEX}]','300','1w','0d','0','3','','bps','','0','','','','','27071',NULL,'','','0','','','','','2',NULL,'','MIB: IF-MIB' || chr(13) || chr(10) || ' An estimate of the interface''s current bandwidth in bits per second.' || chr(13) || chr(10) || 'For interfaces which do not vary in bandwidth or for those where no accurate estimation can be made,' || chr(13) || chr(10) || 'this object should contain the nominal bandwidth.' || chr(13) || chr(10) || 'If the bandwidth of the interface is greater than the maximum value reportable by this object then' || chr(13) || chr(10) || 'this object should report its maximum value (4,294,967,295) and ifHighSpeed must be used to report the interace''s speed.' || chr(13) || chr(10) || 'For a sub-layer which has no concept of bandwidth, this object should be zero.','0','30d','0','0','','0','',NULL)
