INSERT INTO items (itemid,type,snmp_community,snmp_oid,hostid,name,key_,delay,history,trends,status,value_type,trapper_hosts,units,snmpv3_securityname,snmpv3_securitylevel,snmpv3_authpassphrase,snmpv3_privpassphrase,formula,logtimefmt,templateid,valuemapid,params,ipmi_sensor,authtype,username,password,publickey,privatekey,flags,interfaceid,port,description,inventory_link,lifetime,snmpv3_authprotocol,snmpv3_privprotocol,snmpv3_contextname,evaltype,jmx_endpoint,master_itemid) values ('27650','4','{$SNMP_COMMUNITY}','1.3.6.1.2.1.2.2.1.8.{#SNMPINDEX}','10227','Interface {#IFNAME}({#IFALIAS}): Operational status','net.if.status[ifOperStatus.{#SNMPINDEX}]','60','14d','0d','0','3','','','','0','','','','','27107','20','','','0','','','','','2',NULL,'','MIB: IF-MIB' || chr(13) || chr(10) || 'The current operational state of the interface.' || chr(13) || chr(10) || '- The testing(3) state indicates that no operational packet scan be passed' || chr(13) || chr(10) || '- If ifAdminStatus is down(2) then ifOperStatus should be down(2)' || chr(13) || chr(10) || '- If ifAdminStatus is changed to up(1) then ifOperStatus should change to up(1) if the interface is ready to transmit and receive network traffic' || chr(13) || chr(10) || '- It should change todormant(5) if the interface is waiting for external actions (such as a serial line waiting for an incoming connection)' || chr(13) || chr(10) || '- It should remain in the down(2) state if and only if there is a fault that prevents it from going to the up(1) state' || chr(13) || chr(10) || '- It should remain in the notPresent(6) state if the interface has missing(typically, hardware) components.','0','30d','0','0','','0','',NULL)
