INSERT INTO items (itemid,type,snmp_community,snmp_oid,hostid,name,key_,delay,history,trends,status,value_type,trapper_hosts,units,snmpv3_securityname,snmpv3_securitylevel,snmpv3_authpassphrase,snmpv3_privpassphrase,formula,logtimefmt,templateid,valuemapid,params,ipmi_sensor,authtype,username,password,publickey,privatekey,flags,interfaceid,port,description,inventory_link,lifetime,snmpv3_authprotocol,snmpv3_privprotocol,snmpv3_contextname,evaltype,jmx_endpoint,master_itemid) values ('27955','4','{$SNMP_COMMUNITY}','1.3.6.1.2.1.10.7.2.1.19.{#SNMPINDEX}','10235','Interface {#IFNAME}({#IFALIAS}): Duplex status','net.if.duplex[dot3StatsDuplexStatus.{#SNMPINDEX}]','300','1w','0d','0','3','','','','0','','','','','27032','19','','','0','','','','','2',NULL,'','MIB: EtherLike-MIB' || chr(13) || chr(10) || 'The current mode of operation of the MAC' || chr(13) || chr(10) || 'entity.  ''unknown'' indicates that the current' || chr(13) || chr(10) || 'duplex mode could not be determined.' || chr(13) || chr(10) || '' || chr(13) || chr(10) || 'Management control of the duplex mode is' || chr(13) || chr(10) || 'accomplished through the MAU MIB.  When' || chr(13) || chr(10) || 'an interface does not support autonegotiation,' || chr(13) || chr(10) || 'or when autonegotiation is not enabled, the' || chr(13) || chr(10) || 'duplex mode is controlled using' || chr(13) || chr(10) || 'ifMauDefaultType.  When autonegotiation is' || chr(13) || chr(10) || 'supported and enabled, duplex mode is controlled' || chr(13) || chr(10) || 'using ifMauAutoNegAdvertisedBits.  In either' || chr(13) || chr(10) || 'case, the currently operating duplex mode is' || chr(13) || chr(10) || 'reflected both in this object and in ifMauType.' || chr(13) || chr(10) || '' || chr(13) || chr(10) || 'Note that this object provides redundant' || chr(13) || chr(10) || 'information with ifMauType.  Normally, redundant' || chr(13) || chr(10) || 'objects are discouraged.  However, in this' || chr(13) || chr(10) || 'instance,